package com.tec.model;

public class StudentTest {

	private Long id;
	private Account account = null;
	private TestMaster testMaster = null;
	private String status;
	public StudentTest() {
		super();
		// TODO Auto-generated constructor stub
	}
	public StudentTest(Long id, Account account, TestMaster testMaster, String status) {
		super();
		this.id = id;
		this.account = account;
		this.testMaster = testMaster;
		this.status = status;
	}
	public Long getId() {
		return id;
	}
	public void setId(Long id) {
		this.id = id;
	}
	public Account getAccount() {
		return account;
	}
	public void setAccount(Account account) {
		this.account = account;
	}
	public TestMaster getTestMaster() {
		return testMaster;
	}
	public void setTestMaster(TestMaster testMaster) {
		this.testMaster = testMaster;
	}
	public String getStatus() {
		return status;
	}
	public void setStatus(String status) {
		this.status = status;
	}

}
